    id: "m2",
    name: "miso soup",
    price: "2.99",
  },
  {
    id: "m3",
    name: "bao bao",
    price: "8.99",
  },
];

const AvailableMeals = () => {
  return (
    <Fragment>
      <ul>
        <li>
          <div>Sushi - 10</div>
          <button>Add</button>
        </li>
        <li>
          <div>Scnitzel - 5</div>
          <button>Add</button>
        </li>
        <li>
          <div>Burger - 7</div>
          <button>Add</button>
        </li>
      </ul>
      <button>Add</button>
    </Fragment>
  );
};
export default AvailableMeals;
